import React from 'react';
import NavigationBar from './components/NavigationBar';
import SliderComponent from './components/Slider';
import CommunityPosts from './components/CommunityPosts';
import './App.css'; // CSS 파일로 스타일링

const App = () => {
    return (
        <div className="App">
            <NavigationBar />
            <SliderComponent />
            <CommunityPosts />
        </div>
    );
};

export default App;
